import { AiOutlineShoppingCart } from "react-icons/ai";



function AnCIcons(){
    return(
        <div className="ancicons">
            <AiOutlineUser size="20px" />
            <AiOutlineShoppingCart />

        </div>
    )
}

export default AnCIcons;
